import React from "react";
import { CardImageBlock } from "./StyleStoreCard";
const CardImage = ({ images }) => {
  if (images.length < 3) {
    return (
      <>
        <CardImageBlock />
      </>
    );
  } else {
    return (
      <>
        <CardImageBlock style={{ width: "30%", marginRight: 3 }} />
        <CardImageBlock style={{ width: "30%", marginRight: 3 }} />
        <CardImageBlock style={{ width: "30%", marginRight: 3 }} />
      </>
    );
  }
};

export default CardImage;
